/// ExternalCloudAuditService provides methods to manage external cloud audit.
/// It's used only in Teleport Cloud for feature called 'bring your own audit bucket'.
///
/// Creating ExternalCloudAudit does not enable external cloud audit in cluster,
/// it's working as a "draft". Test connection can be executed on draft.
/// To use ExternalCloudAudit in cluster call method PromoteToClusterClusterExternalCloudAudit,
/// which will clone existing ExternalCloudAudit into new resource.
/// Promoted resource can't be mutated, it can be only disabled.
/// To change values in cluster ExternalCloudAudit, first to change "draft",
/// test connection and call PromoteToClusterClusterExternalCloudAudit again.
///
/// Supporting ExternalCloudAudit as resources: "draft" and "cluster", allow us
/// test connection before actually enabling it in cluster.
///
/// To build a server, implement a class that conforms to this protocol.
internal protocol Teleport_Externalcloudaudit_V1_ExternalCloudAuditServiceProvider: CallHandlerProvider {
  var interceptors: Teleport_Externalcloudaudit_V1_ExternalCloudAuditServiceServerInterceptorFactoryProtocol? { get }

  /// GetDraftExternalCloudAudit returns the draft external cloud audit configuration resource.
  func getDraftExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_GetDraftExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Teleport_Externalcloudaudit_V1_GetDraftExternalCloudAuditResponse>

  /// UpsertDraftExternalCloudAudit upserts a draft external cloud Audit resource.
  func upsertDraftExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_UpsertDraftExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Teleport_Externalcloudaudit_V1_UpsertDraftExternalCloudAuditResponse>

  /// DeleteDraftExternalCloudAudit removes draft external cloud Audit resource.
  func deleteDraftExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_DeleteDraftExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<SwiftProtobuf.Google_Protobuf_Empty>

  /// PromoteToClusterExternalCloudAudit promotes the current draft external cloud
  /// audit configuration to be used in the cluster.
  /// This method causes the Teleport Auth service to reload.
  func promoteToClusterExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_PromoteToClusterExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Teleport_Externalcloudaudit_V1_PromoteToClusterExternalCloudAuditResponse>

  /// GetClusterExternalCloudAudit gets cluster external cloud audit.
  func getClusterExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_GetClusterExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Teleport_Externalcloudaudit_V1_GetClusterExternalCloudAuditResponse>

  /// DisableClusterExternalCloudAudit disables the external cloud audit feature.
  /// This method causes the Teleport Auth service to reload.
  func disableClusterExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_DisableClusterExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<SwiftProtobuf.Google_Protobuf_Empty>

  /// GenerateDraftExternalCloudAudit generates a new external cloud audit
  /// resource with randomized resource names and upserts it as the current
  /// draft.
  func generateDraftExternalCloudAudit(request: Teleport_Externalcloudaudit_V1_GenerateDraftExternalCloudAuditRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Teleport_Externalcloudaudit_V1_GenerateDraftExternalCloudAuditResponse>
}

